    render () {
        return (
            <section className="landing-page">
                <Typist className="landing-page__introduction">
                    <span className="landing-page__introduction--partA">Hello!</span>
                    <Typist.Backspace count={13} delay={300} />
                    <span className="landing-page__introduction--partA">I am your music therapist!</span>
                    <Typist.Backspace count={13} delay={300} />
                    <span className='landing-page__introduction--partB'>py!</span>
                </Typist>
            </section>
        )
    }
}
